import axios from "axios"
import React from "react"

const Main = () => {
  const data = {
    name: "Grisha",
    numberPhone: "66666",
  }
  async function fetchData() {
    await axios.post("localhost:5000/api/call", data)
  }
  return (
    <main className="main">
      <button
        type="submit"
        onClick={fetchData}
      >
        Отправить
      </button>
    </main>
  )
}

export default Main
